        <div id="oneTwo">1.2</div>
        <div id="oneThree">.1.3</div>

        <div id="twoOne">2.1</div>
        <div id="twoTwo">2.2</div>
        <div id="twoThree">2.3</div>

        <div id="threeOne">3.1</div>
        <div id="threeTwo">3.2</div>
        <div id="threeThree">3.3</div>
      </div>
    );
  }
}
export default GameBoard;
